    // const theme = useTheme();

    return (
        <>
            <Button variant="contained" color={"primary"}>
                hello
            </Button>
            <Button variant="contained" color={"secondary"}>
                hello
            </Button>
            <Button variant="contained" color={"info"}>
                helllo
            </Button>
        </>
    )
}

export default Stocks;
